import React from "react";

import { createContext } from "react";


const NameContext=createContext('');

function App() {

  return (
    <NameContext.Provider value="Jesus Christ">
      <Body/>
    </NameContext.Provider>

  );
}
function Body(){
  return <Greeting/>
}

function Greeting(){
  return(
    <NameContext.Consumer>
      {name=><h1>welcome ,{name}</h1>}
    </NameContext.Consumer>
  )
}


export default App;
